import { Provider } from "react-redux";
import store from "./store";
import Router from "./Router";
import RootComponent from "./compenents/main";

function App() {
  return (
    <Provider store={store}>
      <Router />
      <RootComponent />
    </Provider>
  );
}

export default App;
